INSERT INTO `adminnotification_inbox` VALUES (1,4,'2017-07-27 21:13:00','Listing your products in marketplaces like Amazon? We want your feedback!','If you sell your products in any marketplace/s today and/or are considering it in the future, we invite you to take our short survey. Your feedback will help us to determine the overall interest and need for integration with marketplace and fulfillment services from companies like Amazon.\n\nThank you in advance.\n\nThe Magento Strategy team','https://www.surveymonkey.com/r/3F5MT75',0,0),(2,4,'2017-08-09 17:30:50','Upgrade to Magento Open Source 2.1.8 for Over 90 Enhancements – 8/8/2017','Magento Open Source (formerly Community Edition) 2.1.8 features over 90 improvements, including cache tuning for better performance, mass action performance optimizations, and faster deployments for multi-language sites. \n\nReview the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(3,4,'2017-08-17 19:13:43','Join the Magento BI Essentials Webinar: Make Data Easy ','Join our webinar on Tuesday, August 22nd and learn about why merchants like you are choosing Magento BI  Essentials to make it easier to harness the power of your data. \n\nBob Moore, Head of Magento BI, will be discussing the value of the reporting and dashboards that comes out-of-the-box with Essentials and the insights you can gain from them. \n\nRegister for free today. \n\nhttps://magento.com/resources/magento-bi-essentials-making-data-easy\n','https://magento.com/resources/magento-bi-essentials-making-data-easy',0,0),(4,4,'2017-08-18 14:41:03','Join the Magento BI Essentials Webinar: Make Data Easy ','Join our webinar on Tuesday, August 22nd and learn about why merchants like you are choosing Magento BI  Essentials to make it easier to harness the power of your data. \n\nBob Moore, Head of Magento BI, will be discussing the value of the reporting and dashboards that comes out-of-the-box with Essentials and the insights you can gain from them. \n\nRegister today. \n\nhttps://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS\n','https://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS',0,0),(5,4,'2017-08-21 20:17:28','Last Chance: Join the Magento BI Essentials Webinar: Make Data Easy ','Join our webinar on Tuesday, August 22nd and learn about why merchants like you are choosing Magento BI  Essentials to make it easier to harness the power of your data. \n\nBob Moore, Head of Magento BI, will be discussing the value of the reporting and dashboards that comes out-of-the-box with Essentials and the insights you can gain from them. \n\nRegister today. \n\nhttps://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS\n','https://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS',0,0),(6,4,'2017-09-08 18:06:52','Survey: Have physical retail stores? If yes, we\'d like your feedback.','If you sell online and through physical storefronts, we\'d like to hear from you.\n\nPlease take our online survey on in-store/ in-branch POS and digital tools.  This survey should take no more than a few minutes to complete.\n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/ZSN9KWC\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/ZSN9KWC',0,0),(7,2,'2017-09-11 22:52:15','USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017','USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Magento is working on a code update to support this change. In the meantime, information about a workaround is available at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html','http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ',0,0),(8,1,'2017-09-14 23:12:36','Important Magento Open Source 2.1.9 and 2.0.16 Security Enhancements – 9/14/2017','Magento Open Source 2.1.9 and 2.0.16 include critical security enhancements and address the September 1 changes to USPS shipping. Please update your site as soon as possible. More information is available in the release notes: \n http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.\n','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(9,4,'2017-09-26 22:42:42','Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017','Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.','http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ',0,0);
