INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-right','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2017-07-07 12:56:20','2017-07-07 12:56:20',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0,0),(2,'Home page','1column','','','home','','<div>{{block class=\"Ktpl\\BannerSlider\\Block\\Banner\" name=\"slider_display\" template=\"Ktpl_BannerSlider::homepage.phtml\"}}</div>','2017-07-07 12:56:20','2017-10-04 07:05:44',1,0,'<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->',NULL,NULL,NULL,NULL,NULL,'',0,0,'[{\"id\":\"option_0\",\"select_type\":\"1\",\"select_block\":\"1\",\"sort_order\":\"1\",\"scrollable\":true},{\"id\":\"option_1\",\"select_type\":\"1\",\"select_block\":\"2\",\"sort_order\":\"2\",\"scrollable\":false},{\"id\":\"option_2\",\"select_type\":\"1\",\"select_block\":\"3\",\"sort_order\":\"3\",\"scrollable\":true},{\"id\":\"option_3\",\"select_type\":\"1\",\"select_block\":\"4\",\"sort_order\":\"4\",\"scrollable\":true},{\"id\":\"option_4\",\"select_type\":\"1\",\"select_block\":\"5\",\"sort_order\":\"5\",\"scrollable\":false},{\"id\":\"option_5\",\"select_type\":\"2\",\"select_block\":\"7\",\"sort_order\":\"6\",\"scrollable\":false},{\"id\":\"option_6\",\"select_type\":\"2\",\"select_block\":\"1\",\"sort_order\":\"7\",\"scrollable\":false}]',1,1),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2017-07-07 12:56:20','2017-07-07 12:56:20',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0,0),(4,'Privacy and Cookie Policy','1column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy and Cookie Policy','<div class=\"privacy-policy cms-content\">\n    <div class=\"message info\">\n        <span>\n            Please replace this text with you Privacy Policy.\n            Please add any additional cookies your website uses below (e.g. Google Analytics).\n        </span>\n    </div>\n    <p>\n        This privacy policy sets out how this website (hereafter \"the Store\") uses and protects any information that\n        you give the Store while using this website. The Store is committed to ensuring that your privacy is protected.\n        Should we ask you to provide certain information by which you can be identified when using this website, then\n        you can be assured that it will only be used in accordance with this privacy statement. The Store may change\n        this policy from time to time by updating this page. You should check this page from time to time to ensure\n        that you are happy with any changes.\n    </p>\n    <h2>What we collect</h2>\n    <p>We may collect the following information:</p>\n    <ul>\n        <li>name</li>\n        <li>contact information including email address</li>\n        <li>demographic information such as postcode, preferences and interests</li>\n        <li>other information relevant to customer surveys and/or offers</li>\n    </ul>\n    <p>\n        For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n    </p>\n    <h2>What we do with the information we gather</h2>\n    <p>\n        We require this information to understand your needs and provide you with a better service,\n        and in particular for the following reasons:\n    </p>\n    <ul>\n        <li>Internal record keeping.</li>\n        <li>We may use the information to improve our products and services.</li>\n        <li>\n            We may periodically send promotional emails about new products, special offers or other information which we\n            think you may find interesting using the email address which you have provided.\n        </li>\n        <li>\n            From time to time, we may also use your information to contact you for market research purposes.\n            We may contact you by email, phone, fax or mail. We may use the information to customise the website\n            according to your interests.\n        </li>\n    </ul>\n    <h2>Security</h2>\n    <p>\n        We are committed to ensuring that your information is secure. In order to prevent unauthorised access or\n        disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and\n        secure the information we collect online.\n    </p>\n    <h2>How we use cookies</h2>\n    <p>\n        A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n        Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n        a particular site. Cookies allow web applications to respond to you as an individual. The web application\n        can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n        your preferences.\n    </p>\n    <p>\n        We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page\n        traffic and improve our website in order to tailor it to customer needs. We only use this information for\n        statistical analysis purposes and then the data is removed from the system.\n    </p>\n    <p>\n        Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find\n        useful and which you do not. A cookie in no way gives us access to your computer or any information about you,\n        other than the data you choose to share with us. You can choose to accept or decline cookies.\n        Most web browsers automatically accept cookies, but you can usually modify your browser setting\n        to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n    </p>\n    <h2>Links to other websites</h2>\n    <p>\n        Our website may contain links to other websites of interest. However, once you have used these links\n        to leave our site, you should note that we do not have any control over that other website.\n        Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n        visiting such sites and such sites are not governed by this privacy statement.\n        You should exercise caution and look at the privacy statement applicable to the website in question.\n    </p>\n    <h2>Controlling your personal information</h2>\n    <p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n    <ul>\n        <li>\n            whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n            that you do not want the information to be used by anybody for direct marketing purposes\n        </li>\n        <li>\n            if you have previously agreed to us using your personal information for direct marketing purposes,\n            you may change your mind at any time by letting us know using our Contact Us information\n        </li>\n    </ul>\n    <p>\n        We will not sell, distribute or lease your personal information to third parties unless we have your permission\n        or are required by law to do so. We may use your personal information to send you promotional information\n        about third parties which we think you may find interesting if you tell us that you wish this to happen.\n    </p>\n    <p>\n        You may request details of personal information which we hold about you under the Data Protection Act 1998.\n        A small fee will be payable. If you would like a copy of the information held on you please email us this\n        request using our Contact Us information.\n    </p>\n    <p>\n        If you believe that any information we are holding on you is incorrect or incomplete,\n        please write to or email us as soon as possible, at the above address.\n        We will promptly correct any information found to be incorrect.\n    </p>\n    <h2><a name=\"list\"></a>List of cookies we collect</h2>\n    <p>The table below lists the cookies we collect and what information they store.</p>\n    <table class=\"data-table data-table-definition-list\">\n        <thead>\n        <tr>\n            <th>Cookie Name</th>\n            <th>Cookie Description</th>\n        </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <th>FORM_KEY</th>\n                <td>Stores randomly generated key used to prevent forged requests.</td>\n            </tr>\n            <tr>\n                <th>PHPSESSID</th>\n                <td>Your session ID on the server.</td>\n            </tr>\n            <tr>\n                <th>GUEST-VIEW</th>\n                <td>Allows guests to view and edit their orders.</td>\n            </tr>\n            <tr>\n                <th>PERSISTENT_SHOPPING_CART</th>\n                <td>A link to information about your cart and viewing history, if you have asked for this.</td>\n            </tr>\n            <tr>\n                <th>STF</th>\n                <td>Information on products you have emailed to friends.</td>\n            </tr>\n            <tr>\n                <th>STORE</th>\n                <td>The store view or language you have selected.</td>\n            </tr>\n            <tr>\n                <th>USER_ALLOWED_SAVE_COOKIE</th>\n                <td>Indicates whether a customer allowed to use cookies.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-SESSID</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE-SECTION-INVALIDATION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-TIMEOUT</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>SECTION-DATA-IDS</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>PRIVATE_CONTENT_VERSION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>X-MAGENTO-VARY</th>\n                <td>Facilitates caching of content on the server to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-FILE-VERSION</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-STORAGE</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n        </tbody>\n    </table>\n</div>','2017-07-07 12:56:20','2017-07-07 12:56:20',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0,0),(5,'All Brands Page','1column',NULL,NULL,'brands',NULL,'<p style=\"text-align: left;\"><span style=\"font-size: small;\"><strong>Searching for a favorite brand? Browse the list below to find just the label you\'re looking for!</strong></span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><strong><br /></strong></span></p>\n<p><img src=\"{{media url=\"wysiwyg/collection/collection-performance.jpg\"}}\" alt=\"\" /></p>\n<p>{{widget type=\"Amasty\\ShopbyBrand\\Block\\Widget\\BrandSlider\" template=\"widget/brand_list/slider.phtml\"}}</p>\n<p>{{widget type=\"Amasty\\ShopbyBrand\\Block\\Widget\\BrandList\" columns=\"3\" template=\"widget/brand_list/index.phtml\"}}</p>','2017-07-13 06:05:54','2017-07-13 06:05:54',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0,0),(7,'Ideas','1column','','','ideas','','','2017-08-28 12:12:09','2017-09-20 05:57:15',1,0,'<referenceContainer name=\"main.content\">\r\n            <block class=\"Ktpl\\Blog\\Block\\Sidebar\\Categories\" name=\"blog.sidebar.category\" template=\"sidebar/categories.phtml\" before=\"-\">\r\n                <action method=\"setCacheLifetime\">\r\n                    <argument name=\"time\" xsi:type=\"string\">86400</argument>\r\n                </action>\r\n            </block>\r\n        </referenceContainer>',NULL,NULL,NULL,NULL,NULL,'',1,0,'[{\"id\":\"option_0\",\"select_type\":\"1\",\"select_block\":\"27\",\"sort_order\":\"1\",\"scrollable\":false},{\"id\":\"option_1\",\"select_type\":\"1\",\"select_block\":\"19\",\"sort_order\":\"2\",\"scrollable\":false},{\"id\":\"option_2\",\"select_type\":\"1\",\"select_block\":\"29\",\"sort_order\":\"3\",\"scrollable\":false},{\"id\":\"option_3\",\"select_type\":\"1\",\"select_block\":\"31\",\"sort_order\":\"4\",\"scrollable\":false},{\"id\":\"option_4\",\"select_type\":\"1\",\"select_block\":\"22\",\"sort_order\":\"5\",\"scrollable\":false},{\"id\":\"option_5\",\"select_type\":\"1\",\"select_block\":\"23\",\"sort_order\":\"6\",\"scrollable\":false},{\"id\":\"option_6\",\"select_type\":\"2\",\"select_block\":\"1\",\"sort_order\":\"7\",\"scrollable\":false}]',1,1),(8,'About Us','1column','','','about-us','About Us','<p>Someone once said that what you do is as important as how you do it. And we couldn&rsquo;t agree more. <br>Why should everyday chores be time consuming and tedious? The urge to simplify these big and small jobs, <br>making them easier, smoother and faster, is what led to our philosophy of designing for convenience. <br>A philosophy that aims to make your every day better.</p>\r\n<p>Thus, the extensive array of products that you see today is nothing but a manifestation of our love for partnering you. <br>Dinnerware to lay out exquisite meals. A cooking range for making finger-licking food. Efficient and easy-to-maintain <br>appliances. On-the-go solutions. Safe and stylish storage. Or even home décor for every occassion. <br>Everything has been thoughtfully designed to make your every day effortless.</p>\r\n<p>For over half a century, we have been a people&rsquo;s brand, one that is synonymous with high-quality, heat-resistant <br>borosilicate glass that surpasses all standards. But we want to achieve much more. Which is why, we&rsquo;re constantly <br>improving and innovating.</p>\r\n<p>Through this website, we want to bring convenience even closer to you - within a click\'s reach, to be precise. <br>Here, you can shop, explore, exchange ideas and do much more. And if at any point, you feel the need to reach out <br>to us, e-mail at <a href=\"mailto:hello@borosil.co.in\">hello@borosil.co.in</a>.</p>','2017-09-01 08:52:44','2017-09-01 09:25:58',1,0,'',NULL,NULL,NULL,NULL,NULL,'',0,0,'',0,0),(9,'Private Sales Homepage','1column',NULL,NULL,'flash-sales-homepage',NULL,NULL,'2017-09-08 08:34:25','2017-09-08 08:34:25',0,0,'\n        <referenceContainer name=\"after.body.start\">\n            <block class=\"Magento\\Framework\\View\\Element\\Template\" name=\"privatesale.homepage.init\" template=\"Plumrocket_PrivateSale::homepage/init.phtml\" />\n            <block class=\"Plumrocket\\PrivateSale\\Block\\Init\" name=\"privatesale.init\" template=\"Plumrocket_PrivateSale::init.phtml\" />\n        </referenceContainer>\n\n        <referenceContainer name=\"content\">\n            <block class=\"Magento\\Framework\\View\\Element\\Template\" name=\"privatesale.homepage.view\" template=\"Plumrocket_PrivateSale::homepage/view.phtml\">\n                <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\" name=\"homepage.events\" template=\"Plumrocket_PrivateSale::homepage/events.phtml\">\n                    <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\\Event\\Item\" name=\"homepage.event.item\" template=\"Plumrocket_PrivateSale::homepage/event/item/default.phtml\" />\n                    <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\\DefaultEvent\" name=\"homepage.default\" template=\"Plumrocket_PrivateSale::homepage/event/default.phtml\" />\n                    <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\\Group\" name=\"homepage.group\" template=\"Plumrocket_PrivateSale::homepage/event/group.phtml\" />\n                    <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\\Comingsoon\" name=\"homepage.coming.soon\" template=\"Plumrocket_PrivateSale::homepage/event/coming_soon.phtml\">\n                        <action method=\"setBlockTitle\">\n                            <argument name=\"title\" xsi:type=\"string\">Coming Soon</argument>\n                        </action>\n                    </block>\n                    <block class=\"Plumrocket\\PrivateSale\\Block\\Homepage\\Endingsoon\" name=\"homepage.ending.soon\" template=\"Plumrocket_PrivateSale::homepage/event/default.phtml\">\n                        <action method=\"setBlockTitle\">\n                            <argument name=\"title\" xsi:type=\"string\">Ending Soon</argument>\n                        </action>\n                    </block>\n\n                    <action method=\"setComingSoonDays\">\n                        <argument name=\"days\" xsi:type=\"string\">3</argument>\n                    </action>\n                    <action method=\"setEndingSoonDays\">\n                        <argument name=\"days\" xsi:type=\"string\">3</argument>\n                    </action>\n                    <action method=\"setEventItemBlock\">\n                        <argument name=\"days\" xsi:type=\"string\">homepage.event.item</argument>\n                    </action>\n                </block>\n            </block>\n        </referenceContainer>',NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,0,0);
