 Carafe with Glass Handle 1.2 L</p>\r\n<p>Mini air plants</p>\r\n<p>White Sand</p>\r\n<p>Moss (Bright works best)</p>\r\n<p>River rocks/aquarium rocks</p>\r\n<p>Decorations</p>\r\n<p>tminiatures - its up to you</p>\r\n<p>Mini air plants</p>\r\n</div>','<div class=\"left-container\"><img src=\"{{media url=\"wysiwyg/blog2.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"right-container\">\r\n<h4>Method</h4>\r\n<p>Step 1 : There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.</p>\r\n</div>','<div class=\"left-container\"><img src=\"{{media url=\"wysiwyg/blog1.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"right-container\">\r\n<p>Step 2 : There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.</p>\r\n</div>',NULL,'Stuff You Need','Method',NULL),(4,'Cadila Set of 6 ',1,NULL,NULL,NULL,'cadila-set-of-6',NULL,NULL,NULL,NULL,NULL,'<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.</p>','2017-08-30 11:18:34','2017-09-14 06:48:07','2017-08-30 00:00:00',1,'ktpl_blog\\blender-big.jpg',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ktpl_blog\\blender-thumbnail.jpg','<p>Your food is a work of art. It shouldn\'t look any less. <strong>Must-have dinner sets for elegant evenings.</strong></p>','favourite-blog-explore-text','font-size:14px;color:red;',1,'Explore Blog','1',NULL,'<h1><span>With quinoa, crunchy haxeinuts and a zingy dressing.</span></h1>\r\n<div class=\"configurations\">\r\n<p><strong>Vegetarian</strong></p>\r\n<p><strong>Serves: 4</strong></p>\r\n<p><strong>Cooks in: 40 minutes</strong></p>\r\n<p><strong>Difficulty: Not too tricky</strong></p>\r\n</div>',NULL,'<h4>Ingredients</h4>\r\n<p>100 g quinoa</p>\r\n<p>250 g purple sprouting broccoli</p>\r\n<p>2 oranges</p>\r\n<p>1 tablespoon tahini</p>\r\n<p>1 tablespoon red wine vinegar</p>\r\n<p>1 teapoon runny honey</p>\r\n<p>extra virgin olive oil</p>\r\n<p>200 g mixed-colour kale</p>\r\n<p>30 g blanched hazelnuts</p>\r\n<h4>Cook and Serve</h4>\r\n<p>Borosil Induction Cooker</p>\r\n<p>Borosil Small Mixin Bowl</p>\r\n<p>Borosil Large Mixin Bowl</p>\r\n<p>Borosil Salad Platter/ Rice Plare</p>','<h4>Preparation</h4>\r\n<ol>\r\n<li>Cook the quinoa according to the packet instructions, then drain.</li>\r\n<li>Place a large frying pan or griddle pan over a medium heat.</li>\r\n<li>Trim the broccoli and cook for 8 to 10 minutes (in batches if you need to), turning occasionally, until slightly charred.</li>\r\n<li>To make a dressing, squeeze the juice of 1 orange into a small bowl. Mix in the tahini, red wine vinegar, honey and 2 tablespoons of oil, then season to taste and set aside.</li>\r\n<li>Remove and discard any hard stalks from the kale, placing the leaves in a large bowl. With your hands, massage in a pinch of salt for 1 minute.</li>\r\n<li>Once the broccoli has charred, add to the kale and tip over half the dressing. Add the quinoa and toss together.</li>\r\n<li>Put the pan you used to cook the broccoli back over a high heat and toast the hazelnuts until golden, then roughly chop.</li>\r\n<li>Add a little more dressing to the salad, toss again, then arrange on a large serving platter.</li>\r\n<li>Peel the remaining orange, slice into rounds and scatter over the salad. Tip over the chopped toasted hazelnuts and serve straight away, with any remaining dressing on the side.</li>\r\n</ol>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Empoli of 6 ',1,NULL,NULL,NULL,'empoli-of-6',NULL,NULL,NULL,NULL,NULL,'<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.</p>\r\n<p>If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet.</p>','2017-08-30 11:19:39','2017-09-12 09:54:00','2017-08-30 00:00:00',1,'ktpl_blog\\vases-big.jpg',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ktpl_blog\\vases-thumbnail.jpg','<p>Everyone looks forward <br>to dessert. Now even more so.<br>\r\n<b>Serve desserts in a unique way. </b>',NULL,NULL,1,'Explore Blog',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Dew Set of 6 ',1,NULL,NULL,NULL,'dew-set-of-6',NULL,NULL,NULL,NULL,NULL,'<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.</p>\r\n<p>If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet.</p>','2017-08-30 11:21:22','2017-09-12 09:48:58','2017-08-30 00:00:00',1,'ktpl_blog\\rice-cooker-big.jpg',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ktpl_blog\\rice-cooker-thumbanil.jpg','<p>Everyone looks forward <br>to dessert. Now even more so.<br>\r\n<b>Serve desserts in a unique way. </b>',NULL,NULL,1,'Explore Blog',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
